import React from "react";
import Button from "@material-ui/core/Button";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogContentText from "@material-ui/core/DialogContentText";
import DialogTitle from "@material-ui/core/DialogTitle";
import useMediaQuery from "@material-ui/core/useMediaQuery";
import { useTheme } from "@material-ui/core/styles";
import { OutReachEditorActions } from "../../OutReachEditor/OutReachEditorReducer";

type ModalProps = {
  clickDraftHandler: () => void;
  clickSavedHandler: () => void;
};

const Modal: React.FC<ModalProps> = (props) => {
  const { clickDraftHandler, clickSavedHandler } = props;
  const [open, setOpen] = React.useState(false);
  const theme = useTheme();
  const fullScreen = useMediaQuery(theme.breakpoints.down("sm"));

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
      <Dialog
        fullScreen={false}
        open={open}
        onClose={handleClose}
        aria-labelledby="responsive-dialog-title"
      >
        <DialogTitle id="responsive-dialog-title">
          {"Use Google's location service?"}
        </DialogTitle>
        <DialogContent>
          <DialogContentText>
            Let Google help apps determine location. This means sending
            anonymous location data to Google, even when no apps are running.
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button autoFocus onClick={clickDraftHandler} color="primary">
            Use Draft
          </Button>
          <Button onClick={clickSavedHandler} color="primary" autoFocus>
            Use Saved
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default Modal;
